// Some constants and helper functions used in the APP drawer

export function formatWhatsAppURL(message: string, phone_number: string): string {
	return `whatsapp://send?text=${message}&phone=${phone_number}`;
}

export const WHATSAPP_DEFAULT_NUMBER = '5516997912990';
export const WHATSAPP_DEFAULT_MSG = 'Olá Fernando, preciso de uma ajuda com o Aplicativo AgroExplore!';
export const WHATSTAPP_DEFAULT_URL = formatWhatsAppURL(WHATSAPP_DEFAULT_MSG, WHATSAPP_DEFAULT_NUMBER);

// this is the default avatar image encoded in base64 (its a small version of the application logo)
export const DEFAULT_AVATAR_B64 = `data:image/jpeg;base64,`;
